export const checkObject = (person, account) => {
    if (account.length === 0) return false;
    else {
      // eslint-disable-next-line array-callback-return
      account.filter((item) => {
        for (let key in person) {
          if (item[key] === undefined || item[key] !== person[key])
            return false;
        }
        return true;
      });
    }
  };
